//Основной компонент,компанирует все элементы
import React from 'react';

class App extends React.Component {
  render(){
    return(
        <div>
          <div>Hello</div>
          <h2>Hello</h2>
        </div>
    );
  }
}

//экспортируем для подключения
export default App;
